WHERE
  { ?objOfProp  <http://dbpedia.org/ontology/gender>  <http://dbpedia.org/resource/Female> ;
              a                     <http://dbpedia.org/ontology/Agent> ;
              <http://www.w3.org/2000/01/rdf-schema#label>  ?label
    FILTER langMatches(lang(?label), "EN")
